import React, { Component } from 'react'
import { Link } from 'react-router-dom'



export default class Home extends Component {
    render() {
        return (
             <div className='container'>
                <div className='pt-4'>
                    <h1>Welcome to my React Shop!</h1>
                    <Link to='/products'>
                    <img src="https://miro.medium.com/max/3200/1*qXcjSfRj0C0ir2yMsYiRyw.jpeg" className='img-fluid rounded' to='/products' />
                    </ Link>
                </div>
            </div>
        )
    }
}
